def boiling_material(boiling_map, boiling_point):    materials=dict()    materials[boiling_map]=boiling_point    if materials.get(boiling_map) < (materials.get(boiling_map)//5)*100:        return print('not equal 5%')    return boiling_map#-------------------def odd_sum(n):    if n <= 1:        return 1    odd = 0    for i in range(0, n-1):        if n % 2 != 0:            odd += n    return oddodd_sum(2222)